def data1(a):
    wb = openpyxl.load_workbook(a)  # 打开excel文件
    sheet = wb.active  # 正对表格
    n1 = sheet.max_row
    n2 = 4

    data = [[] for _ in range(n1)]
    list = [[] for _ in range(n2)]


    for column in range(1, n1 + 1):
        for row in range(1, n2 + 1):
            list[row - 1] = sheet.cell(column, row).value
        data[column - 1] = list
        list = [[] for _ in range(n2)]

    a = data[1][3]
    b = data[1][1]
    H0 = data[1][2]
    def f(x):
        return 1 / ((H0 / 3.08568) * 10 ** (-19) * math.sqrt((1 + x) ** 3 * b + a))
    Dl = [[] for _ in range(n1)]
    # 光速c=3*10^8m/s=3*10^10cm/s
    c = 3 * 10 ** 10
    for i in range(0, n1):
        if (i == 0):
            Dl[i] = 'Dl/cm'
        else:
            Dl[i] = integrate.quad(f, 0, data[i][0])[0] * c * (data[i][0] + 1)
    # 在内存创建一个工作簿
    wb = Workbook()
    ws = wb.active
    for i in range(0, n1):
        for j in range(0, n2):
            ws.cell(row=i + 1, column=j+1).value = data[i][j]
        ws.cell(row=i + 1, column=n2+1).value = Dl[i]
    # 保存文档
    wb.save('DL1.xlsx')
def data2(a):
    wb = openpyxl.load_workbook(a)  # 打开excel文件
    sheet = wb.active  # 正对表格
    n1 = sheet.max_row
    n2 = sheet.max_column

    data = [[] for _ in range(n1)]
    list = [[] for _ in range(n2)]


