def data5(a):
    def PoissonerrorLow(n, CL):
        y = 1
        low = 2000
        high = 0
        a = 0
        while math.fabs(y) > 0.00001:
            x = 0
            mid = (low + high) / 2
            for i in range(0, n):
                x += mid ** i * math.exp(-mid) / math.factorial(i)
            y = x - CL
            if y < 0:
                low = mid
            elif y > 0:
                high = mid
            a = mid
        return a

    def PoissonerrorHigh(n, CL):
        y = 1
        low = 2000
        high = 0
        a = 0
        while math.fabs(y) > 0.00001:
            x = 0
            mid = (low + high) / 2
            for i in range(0, n + 1):
                x += mid ** i * math.exp(-mid) / math.factorial(i)
            y = x + CL - 1
            if y < 0:
                low = mid
            elif y > 0:
                high = mid
            a = mid
        return a

    wb = openpyxl.load_workbook(a)  # 打开excel文件
    sheet = wb.active  # 正对表格
    n1 = sheet.max_row
    n2 = sheet.max_column

    data = [[] for _ in range(n1)]
    list = [[] for _ in range(n2)]

    for column in range(1, n1 + 1):
        for row in range(1, n2 + 1):
            list[row - 1] = sheet.cell(column, row).value
        data[column - 1] = list
        list = [[] for _ in range(n2)]
    CL = data[1][3]
    error_low = [[] for _ in range(n1)]
    error_high = [[] for _ in range(n1)]
    for i in range(0, n1):
        if (i == 0):
            error_low[i] = 'error_low'
            error_high[i] = 'error_high'
        else:
            error_high[i] = round(PoissonerrorHigh(data[i][2],CL),3) - data[i][2]
            error_low[i] = data[i][2] - round(PoissonerrorLow(data[i][2], CL), 3)
    # 在内存创建一个工作簿
    wb = Workbook()
    ws = wb.active
    for i in range(0, n1):
        for j in range(0, n2):
            ws.cell(row=i + 1, column=j + 1).value = data[i][j]
        ws.cell(row=i + 1, column=n2 + 1).value = error_low[i]
        ws.cell(row=i + 1, column=n2 + 2).value = error_high[i]
    # 保存文档
    wb.save('phe1.xlsx')
